  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
  Encoding and Referencing (MAF/TIGER) Database (MTDB). The MTDB represents a seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed to stand alone as an independent data set, or they can be combined to
  cover the entire nation. The American Indian/Alaska Native/Native Hawaiian (AIANNH)
  Areas Shapefile includes the following legal entities: federally recognized American
  Indian reservations and off-reservation trust land areas, state-recognized American
  Indian reservations, and Hawaiian home lands (HHLs). The statistical entities included
  are Alaska Native village statistical areas (ANVSAs), Oklahoma tribal statistical
  areas (OTSAs), tribal designated statistical areas (TDSAs), and state designated
  tribal statistical areas (SDTSAs). Joint use areas are also included in this shapefile
  refer to areas that are administered jointly and/or claimed by two or more American
  Indian tribes. The Census Bureau designates both legal and statistical joint use
  areas as unique geographic entities for the purpose of presenting statistical data.
  The Bureau of Indian Affairs (BIA) within the U.S. Department of the Interior (DOI)
  provides the list of federally recognized tribes and only provides legal boundary
  information when the tribes need supporting records, if a boundary is based on treaty
  or another document that is historical or open to legal interpretation, or when
  another tribal, state, or local government challenges the depiction of a reservation
  or off-reservation trust land. The boundaries for federally recognized American
  Indian reservations and off-reservation trust lands are as of January 1, 2016, as
  reported by the federally recognized tribal governments through the Census Bureau's
  Boundary and Annexation Survey (BAS). The boundaries for state-recognized American
  Indian reservations and for SDTSAs were delineated by a state governor-appointed
  liaisons for the 2010 Census through the State American Indian Reservation Program
  and TSAP respectively. In order to create this file, the U.S. EPA Region 5 extracted
  the Indian land boundaries within Michigan, Minnesota and Wisconsin, created map
  labels based on preferred Region 5 names, and gathered tribal government web site
  locations. Please see Processing Steps and Attribute Information for more information.\",\n\t\"license_title\":
